import React, { useState } from 'react';
import { Card, CardContent } from './ui/card';
import { Badge } from './ui/badge';
import { ExternalLink, Clock, User } from 'lucide-react';

function Portfolio({ items = [], loading = true }) {
  const [filter, setFilter] = useState('All');

  const categories = ['All', 'Web Development', 'UI/UX Design', 'Landing Page'];

  const filteredItems =
    filter === 'All'
      ? items
      : items.filter(item => item.category === filter);

  return (
    <section
      id="portfolio"
      className="py-20 px-4 sm:px-6 lg:px-8 relative"
    >
      <div className="max-w-7xl mx-auto">

        {/* Header */}
        <div className="text-center mb-12">
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-4">
            Our Portfolio
          </h2>
          <p className="text-xl text-gray-400 max-w-2xl mx-auto">
            Explore our recent projects and see how we bring ideas to life
          </p>
        </div>

        {/* Filters */}
        <div className="flex flex-wrap justify-center gap-3 mb-12">
          {categories.map(category => (
            <button
              key={category}
              onClick={() => setFilter(category)}
              className={`px-6 py-2 rounded-full transition-all ${
                filter === category
                  ? 'bg-blue-500 text-white'
                  : 'bg-white/5 text-gray-400 hover:bg-white/10 hover:text-white'
              }`}
            >
              {category}
            </button>
          ))}
        </div>

        {/* Content */}
        {loading ? (
          <div className="text-center text-gray-400 py-12">
            Loading portfolio...
          </div>
        ) : filteredItems.length === 0 ? (
          <div className="text-center text-gray-400 py-12">
            No projects found.
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {filteredItems.map((item, index) => (
              <Card
                key={item.id || index}
                className="bg-white/5 border-white/10 backdrop-blur-lg overflow-hidden"
              >
                {/* Image */}
                <div className="relative h-48 overflow-hidden">
                  <img
                    src={item.image}
                    alt={item.title}
                    className="w-full h-full object-cover"
                  />

                  {item.link && (
                    <a
                      href={item.link}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="absolute top-4 right-4 p-2 bg-white/20 rounded-full"
                    >
                      <ExternalLink className="h-5 w-5 text-white" />
                    </a>
                  )}

                  <Badge className="absolute top-4 left-4 bg-blue-500 text-white">
                    {item.category}
                  </Badge>
                </div>

                {/* Content */}
                <CardContent className="p-6">
                  <h3 className="text-xl font-bold text-white mb-2">
                    {item.title}
                  </h3>

                  <p className="text-gray-400 text-sm mb-4">
                    {item.description}
                  </p>

                  {/* Meta */}
                  <div className="flex gap-3 text-xs text-gray-500 mb-4">
                    {item.client && (
                      <span className="flex items-center gap-1">
                        <User className="h-3 w-3" />
                        {item.client}
                      </span>
                    )}
                    {item.duration && (
                      <span className="flex items-center gap-1">
                        <Clock className="h-3 w-3" />
                        {item.duration}
                      </span>
                    )}
                  </div>

                  {/* Tech */}
                  <div className="flex flex-wrap gap-2">
                    {(item.technologies || []).slice(0, 4).map((tech, idx) => (
                      <span
                        key={idx}
                        className="px-2 py-1 text-xs rounded bg-white/5 text-gray-400"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>
                </CardContent>
              </Card>
            ))}
          </div>
        )}
      </div>
    </section>
  );
}

export default Portfolio;
